    def OpenFile(self):
        global path
        try:
            path = QFileDialog.getOpenFileName(self.load_data, "open.csv", os.getenv('HOME'), 'CSV(*.csv)')[0]
            self.all_data = pd.read_csv(path)
        except:
            print(path)

    def dataHead(self):
        try:
            NumRows = len(self.all_data.index)
            self.reading_table.setColumnCount(len(self.all_data.columns))
            self.reading_table.setRowCount(NumRows)
            self.reading_table.setHorizontalHeaderLabels(self.all_data.columns)

            for i in range(NumRows):
                for j in range(len(self.all_data.columns)):
                    self.reading_table.setItem(i, j, QTableWidgetItem(str(self.all_data.iat[i, j])))

            self.reading_table.resizeColumnsToContents()
            self.reading_table.resizeRowsToContents()
        except:
            pass

    def save_dataset(self):
        global name
        try:
            if self.all_data is not None:
                name = QFileDialog.getSaveFileName(self.save_button, 'Save File', filter='*.csv')
                self.all_data.to_csv(name[0], index=False)
        except:
            pass

    def load_graph(self):
        try:
            x = np.linspace(0, 10, 100)
            y = 4 + 2 * np.sin(2 * x)
            # plot
            fig, ax = plt.subplots()
            ax.plot(x, y, linewidth=2.0)
            ax.set(xlim=(0, 8), xticks=np.arange(1, 8),
                   ylim=(0, 8), yticks=np.arange(1, 8))
            plt.show()
        except:
            pass

